output_sparql:
prefix bag: <https://bag.basisregistraties.overheid.nl/bag2/def/>
prefix foaf: <http://xmlns.com/foaf/0.1/>
prefix nen3610: <http://definities.geostandaarden.nl/def/nen3610#>
prefix prov: <http://www.w3.org/ns/prov#>
prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>
prefix wde: <http://www.wikidata.org/entity/>
prefix wdn: <http://www.wikidata.org/prop/direct-normalized/>
prefix wdt: <http://www.wikidata.org/prop/direct/>
select 
  (strdt(concat(
    '<dl>',
    '<dt>Kerk</dt><dd>',str(?label),'</dd>',
    '<dt>BAG bouwjaar</dt><dd>',str(?bouwjaar),'</dd>',
    '<dt>BAG ID</dt><dd><a href="',str(?pandRegistratie),'" target="_blank">',str(?pandId),'</a></dd>',
    '<dt>Wikidata ID</dt><dd><a href="',str(?wikidata),'" target="_blank">',substr(str(?wikidata),32),'</a></dd>',
    '</dl>',
    '<img width="285" src="',str(?img),'">'),rdf:HTML) as ?widget)
{
  {
    select ?pandId ?wikidata (sample(?label) as ?label) (sample(?img) as ?img) {
      service <https://query.wikidata.org/sparql> {
        ?wikidata
          wdt:P5208 ?pandId;
          wdt:P18 ?img;
          rdfs:label ?label;
          wdt:P31 wde:Q16970.
        filter(lang(?label) = 'nl')
      }
    }
    group by ?pandId ?wikidata
  }
  ?pandRegistratie
    bag:bouwjaar ?bouwjaar;
    foaf:primaryTopic/nen3610:identificatie/nen3610:lokaalID ?pandId.
  filter not exists { ?pandRegistratie prov:invalidatedAtTime []. }
}
limit 6
